# https://leetcode.com/problems/minimize-malware-spread/discuss/181186/python-dfs-solution-with-picture-to-explain-my-thought(with-extra-Chinese-explanation)
class UnionFind:
    def __init__(self,n):
        self.n=n
        self.par=[i for i in range(n)]
        self.size=[1 for _ in range(n)]
    def __repr__(self): return str(self.par)
    def union(self,a,b):
        a=self.find(a)
        b=self.find(b)
        if a!=b:
            if self.size[a]<self.size[b]:
                a,b=b,a
            self.par[b]=a
            self.size[a]+=self.size[b]
    def find(self,a):
        if a!=self.par[a]:
            self.par[a]=self.find(self.par[a])
        return self.par[a]
    def getNodeCount(self, a):
        return self.size[self.find(a)]
    def getMalwareCounter(self,li:List[int]):
        return Counter(self.find(x) for x in li)

class Solution:
    def minMalwareSpread(self, graph, initial):
        n = len(graph)
        uf=UnionFind(n)
        for i in range(n):
            for j in range(i + 1, n):
                if graph[i][j] == 1:
                    uf.union(i, j)
        malCount = uf.getMalwareCounter(initial)
        save, res = 0, min(initial)
        for i in initial:
            if malCount[uf.find(i)] == 1:
                if uf.getNodeCount(i) > save:
                    save, res = uf.getNodeCount(i), i
                elif uf.getNodeCount(i) == save: # get min index
                    res = min(res, i)
        return res


